// Dependencies.
import React from 'react';

// Component 'AboutMe'.
function AboutMe() {
    return (
        // AboutMe Container.
        <>
            <div id="AboutMe">
                <div id="JumboAbout" class="jumbotron jumbotron-fluid">
                    <div class="container">
                        <div class="row">
                            <div class="col-sm">
                            <p id="AboutContext" className="lead ml-3">I'm just a young developer with a passion for creation! Since my childhood, I've always been interested in what's going on behind the scenes of video games, computers, and of course, websites! After making my first "game" in Batch at the age of twelve I've been coding ever since. For the past few years I've fiddled with markup languages like HTML & CSS, worked in frameworks like Bootstrap, learned languages like JavaScript and libraries like jQuery all alongside experimenting with many other different languages and frameworks which have helped me do things I never thought I could ever do by myself. This website is a place for me to showcase the work I've done over the years, giving you a sneak peak at everything I've accomplished as a developer! When I'm not being a developer, I'm usually either playing video games, hanging with friends, or on a good day, going out to eat, which is one of my favorite things to do!</p>
                                <img id="iamshawn-profile2" className="img-thumbnail" alt="iamshawn2.jpg" src="../../assets/misc/iamshawn2.jpg" />
                               
                            </div>
                        </div>
                        <div class="row">
                            <div class="col-sm">
                                <h1 className="display-4">Shawn Luther</h1>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}

// Do export.
export default AboutMe;
